Templates.template:
new sap.ui.vbm.Boxes(
	"${sId}", // string
	{
		posChangeable: ${bPosChangeable}, // boolean
		scaleChangeable: ${bScaleChangeable}, // boolean
		items: [${items}] // sap.ui.vbm.Box[]
	}
)

new sap.ui.vbm.Cluster(
	"${sId}", // string
	{
		color: ${color}, // sap.ui.core.CSSColor
		icon: "${icon}", // string
		text: "${text}", // string
		type: ${sap.ui.vbm.SemanticType.None} // sap.ui.vbm.SemanticType
	}
)

openDetailWindow(
	"${oSpotInst}", // sap.ui.vbm.Spot
	{
		caption: "${caption}", // string
		offsetX: "${offsetX}", // string
		offsetY: "${offsetY}" // string
	}
)

new sap.ui.vbm.DragSource(
	"${sId}", // string
	{
		type: "${type}" // string
	}
)

new sap.ui.vbm.DropTarget(
	"${sId}", // string
	{
		type: "${type}" // string
	}
)

new sap.ui.vbm.Feature(
	"${sId}", // string
	{
		color: ${color}, // sap.ui.core.CSSColor
		featureId: "${featureId}", // string
		click: [function (oEvent) {}, this], // function|array
		contextMenu: [function (oEvent) {}, this] // function|array
	}
)

openDetailWindow(
	"${oFeature}", // sap.ui.vbm.Feature
	{
		caption: "${caption}", // string
		offsetX: "${offsetX}", // string
		offsetY: "${offsetY}" // string
	}
)

openDetailWindow(
	"${sPosition}", // string
	{
		caption: "${caption}" // string
	}
)

setMapConfiguration(
	{
		MapProvider: [${MapProvider}], // array
		MapLayerStacks: [${MapLayerStacks}] // array
	}
)

new sap.ui.vbm.Legend(
	"${sId}", // string
	{
		caption: ${"???"}, // string
		items: [${items}], // sap.ui.vbm.LegendItem[]
		click: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vbm.LegendItem(
	"${sId}", // string
	{
		color: ${""}, // string
		image: "${image}", // string
		semanticSpotType: ${semanticSpotType}, // sap.ui.vbm.SemanticType
		text: "${text}", // string
		click: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vbm.PieItem(
	"${sId}", // string
	{
		name: ${""}, // string
		value: "${value}", // string
		click: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vbm.Region(
	"${sId}", // string
	{
		color: ${color}, // sap.ui.core.CSSColor
		code: "${code}", // string
		select: ${bSelect}, // boolean
		click: [function (oEvent) {}, this], // function|array
		contextMenu: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vbm.Resource(
	"${sId}", // string
	{
		value: "${value}", // string
		src: ${""}, // string
		name: "${name}" // string
	}
)

openDetailWindow(
	"${oVoInst}", // sap.ui.vbm.VoBase
	{
		caption: "${caption}", // string
		offsetX: "${offsetX}", // string
		offsetY: "${offsetY}" // string
	},
	"${bUseClickPos}" // boolean
)
